var detrolService={add:function(e,t){try{connector.post("/detrol/add",JSON.stringify(e),function(e){null!=e?(successMessage({title:message.detrol.add.title,content:message.detrol.add.success}),t(e)):errorMessage({title:message.detrol.add.title,content:message.detrol.add.error})})}catch(e){console.log(e)}},update:function(e,t){try{connector.post(url.detrol.update,e,function(e){null!=e&&1===e?(successMessage({title:message.detrol.update.title,content:message.detrol.update.success}),t(e)):errorMessage({title:message.detrol.update.title,content:message.detrol.update.error})})}catch(e){console.log(e)}},list:function(t){try{connector.post(url.detrol.list,JSON.stringify({id:1}),function(e){null!=e&&0<e.length?t(e):infoMessage({title:message.detrol.list.title,content:message.detrol.list.empty})})}catch(e){console.log(e)}},remove:function(e,t){try{connector.post(url.detrol.delete,JSON.stringify(e),function(e){e?(successMessage({title:message.detrol.delete.title,content:message.detrol.delete.success}),t(e)):errorMessage({title:message.detrol.delete.title,content:message.detrol.delete.error})})}catch(e){console.log(e)}},getLeaders:function(e,t){try{connector.post("/detrol/getLeaders",JSON.stringify(e),function(e){t(e)})}catch(e){console.error(e)}}};